import './App.css';

import {BrowserRouter as Router, Route, Routes} from "react-route-dom";
import Home from "./Pages/Home";
import Quiz from "./Pages/Quiz";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/home" component={Home} />
        <Route exact path="/quiz" component={Quiz} />
      </Switch>
    </Router>
  );
}


export default App;
